	(55, '', '', 'Cowboy Hat', '', '', '', 'cowboy-hat'),
	(59, 'This is a default product.', '<p>Default product with standart settings no customfields. You can set:</p>\r\n<p>Tab Product Information<br />- General: Published, On Featured, Product SKU, Product Name, Produkt alias, URL, <br />- Assignation:Manufacturer, Product Categories, Shopper Groups, Type of Product detail page<br />- Product pricing: Cost price, Base price, Final price, Override, and priceranges dependant on Shopper group.<br />- You can add Child products here also.</p>\r\n<p>Tab Product Description<br />- Description, Short descriptionm Meta information</p>\r\n<p>Tab Product Status<br />- Stock amount, Low Stock notification, Minimum and maximum purchase quantity, Availability Date + image<br />- Booked, ordered products amount, Quantity Steps<br />- Also it is possible to send email to shopper who bought this product.</p>\r\n<p>Tab Dimension and Weight<br />- Lenght, Width, Height, Weight, Packing, and Units in Box</p>\r\n<p>Tab Product images<br />- Use already uploaded images<br />- Set image information<br />- Upload new image<br />- manage thumbnail</p>\r\n<p>Tab Custom Fields<br />- Set related Categories &amp; Products<br />- Select customfields</p>\r\n<p> </p>\r\n<p>Lorem ipsum dolor sit amet, consetetur sadipscing elitr, sed diam nonumy eirmod tempor invidunt ut labore et dolore magna aliquyam erat, sed diam voluptua. At vero eos et accusam et justo duo dolores et ea rebum. Stet clita kasd gubergren, no sea takimata sanctus est Lorem ipsum dolor sit amet. Lorem ipsum dolor sit amet, consetetur sadipscing elitr, sed diam nonumy eirmod tempor invidunt ut labore et dolore magna aliquyam erat, sed diam voluptua.</p>\r\n<p>At vero eos et accusam et justo duo dolores et ea rebum. Stet clita kasd gubergren, no sea takimata sanctus est Lorem ipsum dolor sit amet.</p>\r\n<p>Lorem ipsum dolor sit amet, consetetur sadipscing elitr, sed diam nonumy eirmod tempor invidunt ut labore et dolore magna aliquyam erat, sed diam voluptua. At vero eos et accusam et justo duo dolores et ea rebum. Stet clita kasd gubergren, no sea takimata sanctus est Lorem ipsum dolor sit amet.   <br /><br /></p>', 'Default product', '', '', '', 'default-product'),
	(60, 'Default parent product for child products', '<p>This is a default product used as pattern. There are Custom Fields Cart Variant and Textarea. <br /><br />The content of Customfields can be changed by overwriting parental content. (Product child of PATTERN 7)</p>', '1- Product 1st PATTERN', '', '', '', 'product-pattern'),
	(61, 'Child product to show usage of Pattern.', '<p>This is a child product of a pattern. The Pattern is created to reduce workload when you create a huge amount of product that use all the same settings like: price, settings, customfields, and so on. Of course you can overwrite settings of parent product.</p>', '2- 1st pattern CHILD 1', '', '', '', '1st-pattern-child-1'),
	(62, 'Child product to show usage of Pattern.', '<p>This is a child product of a pattern. The Pattern is created to reduce workload when you create a huge amount of product that use all the same settings like: price, settings, customfields, and so on. Of course you can overwrite settings of parent product.</p>', '3- 1st pattern CHILD 2', '', '', '', '1st-pattern-child-2'),
	(63, 'Child product to show usage of Pattern.', '<p>This is a child product of a pattern. The Pattern is created to reduce workload when you create a huge amount of product that use all the same settings like: price, settings, customfields, and so on. When you set values in child product the parental will be overwritten.</p>', '4- 1st pattern CHILD 3', '', '', '', '1st-pattern-child-3'),
	(68, 'Several colors as CHILD products available.', '<p>Lorem ipsum dolor sit amet, consetetur sadipscing elitr, sed diam nonumy eirmod tempor invidunt ut labore et dolore magna aliquyam erat, sed diam voluptua. At vero eos et accusam et justo duo dolores et ea rebum. Stet clita kasd gubergren, no sea takimata sanctus est Lorem ipsum dolor sit amet. Lorem ipsum dolor sit amet, consetetur sadipscing elitr, sed diam nonumy eirmod tempor invidunt ut labore et dolore magna aliquyam erat, sed diam voluptua. At vero eos et accusam et justo duo dolores et ea rebum. Stet clita kasd gubergren, no sea takimata sanctus est Lorem ipsum dolor sit amet. Lorem ipsum dolor sit amet, consetetur sadipscing elitr, sed diam nonumy eirmod tempor invidunt ut labore et dolore magna aliquyam erat, sed diam voluptua. At vero eos et accusam et justo duo dolores et ea rebum. Stet clita kasd gubergren, no sea takimata sanctus est Lorem ipsum dolor sit amet.<br /><br />Duis autem vel eum iriure dolor in hendrerit in vulputate velit esse molestie consequat, vel illum dolore eu feugiat nulla facilisis at vero eros et accumsan et iusto odio dignissim qui blandit praesent luptatum zzril delenit augue duis dolore te feugait nulla facilisi. Lorem ipsum dolor sit amet,</p>', 'Underwear combo PARENT', '', '', '', 'underwear-combo-parent'),
	(69, '', '', 'Blue Underwear combo CHILD', '', '', '', 'underwear-combo-parent681'),
	(70, '', '', 'Red Underwear combo CHILD', '', '', '', 'red-underwear-combo-child'),
	(71, '', '', 'White Underwear combo CHILD', '', '', '', 'white-underwear-combo-child'),
	(72, 'Product with child variant; parent ordable', '<p>This product will explain the usage of customfield generic (dynamic) child variant. The base product is ordable in this case.</p>\r\n<p>Consider you sell products in different color settings: you want to change the color of the product by selecting a color variant.<br />Therefore dynamic child variants can be used to allow you different description, images, or product status for every variant of your base product.<br /><br />Set up a new product, set price, add child products. Add created customfield generic child variant. <br />The child products are assigned to another unpublished category as the parent product.<br />Tick the checkboxes <em>Display parent as option</em> (compare with images.)<br /><br /></p>', 'Product w/child variant', '', '', '', 'default-product-child-variant'),
	(73, '', '', 'child variant 1', '', '', '', 'default-product-child-variant725'),
	(74, '', '', 'child variant 2', '', '', '', 'default-product-child-variant722'),
	(75, '', '', 'child variant 3', '', '', '', 'default-product-child-variant723'),
	(76, 'It\'s a free Product!', '<p>This product shows how a free product is set up. At least let price empty. The shopper can purchase without beeing charged. In settings you decide if an invoice will be created for free products. In all cases the shopper needs to checkout.</p>\r\n<p>It can be used e.g. if you want to offer catalogue or merchendise products.</p>', 'Free product', '', '', '', 'free-default-product'),
	(77, 'Default product with cart variants modifies price.', '<p>Custom Field with Cart Attribute allows you to add some options to a product that can modify the product price. For example, you may wish to sell a book, or the downladable version of it. And the price is different in both case.<br /><br />In this case you can select different variants. Default, Variant A,B, or C. The price will be modified by selection. In VM configuration you can also select either tax should be applied to cart variant in customfield.</p>', 'Product w/cart variant', '', '', '', 'default-product-cart-variant'),
	(78, 'Product with child variant; parent not ordable', '<p>This product will explain the usage of customfield generic (dynamic) child variant. The base product is not ordable in this case.</p>\r\n<p>Consider you sell products in different color settings: you want to change the color of the product by selecting a color variant.<br />Therefore dynamic child variants can be used to allow you different description, images, or product status for every variant of your base product.<br /><br />Set up a new product, set price, add child products. Add created customfield generic child variant. <br />The child products are assigned to another unpublished category as the parent product.<br />Do not tick the checkbox <em>Display parent as option</em> (compare with images.)</p>', 'Product w/child variant parent not ordable', '', '', '', 'default-product-child-variant-72'),
	(79, '', '', 'Default product child variant 1', '', '', '', 'default-product-child-variant-72785'),
	(80, '', '', 'Default product child variant 2', '', '', '', 'default-product-child-variant-72786'),
	(81, '', '', 'Default product child variant 3', '', '', '', 'default-product-child-variant-72787'),
	(82, 'Example for second Pattern.', '', '5- Product 2nd PATTERN', '', '', '', 'product-2nd-pattern'),
	(83, 'Child product to show usage of Pattern.', '<p>This is a child product of a pattern. The Pattern is created to reduce workload when you create a huge amount of product that use all the same settings like: price, settings, customfields, and so on. Of course you can overwrite settings of parent product.</p>', '6- 2nd pattern CHILD 1', '', '', '', 'product-2nd-pattern823'),
	(84, 'Child product to show usage of Pattern.', '<p>This is a child product of a pattern. The Pattern is created to reduce workload when you create a huge amount of product that use all the same settings like: price, settings, customfields, and so on. Of course you can overwrite settings of parent product.</p>', '7- 2nd pattern CHILD 2', '', '', '', 'product-2nd-pattern821'),
	(85, 'Child product to show usage of Pattern.', '<p>This is a child product of a pattern. The Pattern is created to reduce workload when you create a huge amount of product that use all the same settings like: price, settings, customfields, and so on. Of course you can overwrite settings of parent product.</p>', '8- 2nd pattern CHILD 3', '', '', '', 'product-2nd-pattern823-1'),
	(96, 'This is a default product with customfield textarea.', '<p>Default product with one customfield textarea you see this customfield content below.</p>\r\n<p>You can use customfield textarea to add further informating apart from product description.</p>\r\n<p> </p>', 'Product w/customfield textarea', '', '', '', 'default-product-59'),
