	(126, '', '', '33- 2nd pattern CHILD 10', '', '', '', 'product-2nd-pattern825'),
	(127, 'Showcase for pattern usage.', '<p>This product is used as a pattern for other products. It is a parent product and has multiple child products. <br />You can set several settings (content, customfields) for parent product. Childs of this parent will basically have the same settings as the parent automatically inherite until you overwrite.<br /><br /></p>\r\n<p>In this case product price is set in pattern.</p>', 'Basic PATTERN', '', '', '', 'pattern'),
	(131, '', '<p>This is a basic child of Product PATTERN. You see inherited settings. <br />Overwritten are following setting/content:<br />- Product desc<br />- Product price<br /><span style="background-color: yellow;"><br />Basically Manufacturer and Category are not inherited, for showcase reason both are set in this case.</span></p>', 'Basic price overwrite', '', '', '', 'price-overwrite'),
	(128, 'Default product with customfield string', '<p>This is a default product with standart settings and a customfield type string. You can set:<br /> - Title (text)<br />- Show title (select)<br />- Published (select)<br />- Select parent customfield (for building a pattern of multiple customfields at once) (select)<br />- Cart Attribut (select)<br />- Description (text)<br />- Default (text)<br />- Tooltip (text)<br />- Layout position<br />- Admin only (select)<br />- Is a list (select)<br />- Hidden (select)</p>', 'Product w/customfield string', '', '', '', 'product-w-customfield-string'),
	(129, 'This is a default product with standart settings and a customfield type parent.', '<p>You can set use customfield type parent to bind multiple child customfields into a parental bundle.<br /><br />For example for books, you may wish to always give the following description:</p>\r\n<p>Reading level: Ages 9-12<br />Hardcover: 224 pages<br />Publisher: Amulet Books (November 15, 2011)<br />Language: English<br />ISBN-10: 1419702238<br />ISBN-13: 978-1419702235</p>\r\n<p>Therefore bind multiple customfields e.g. string into a parent customfield to use it as a pattern.</p>', 'Product w/customfield parent', '', '', '', 'product-w-customfield-parent'),
	(130, '', '<p>This is a basic child of Product PATTERN. You see inherited settings, only Product description is overwritten.<br /><span style="background-color: yellow;">Basically Manufacturer and Category are not inherited, for showcase reason both are set in this case.</span></p>', 'Basic child', '', '', '', 'basic-child'),
	(132, 'Multiple overwrites short desc.', '<p>This is a child of Product PATTERN. Most inherited settings are overwritten: <br />- Short desc<br />- Product desc<br />- Product price<br />- Product Images<br />- Product Dimension and Weight (Units in Box)<br /><span style="background-color: yellow;"><br />Manufacturer and Category are not inherited</span></p>', 'Basic multiple overwrites', '', '', '', 'multiple-overwrites'),
	(133, 'Showcase advanced pattern usage.', '<p>This product is used as a pattern for other products. It is a parent product and has multiple child products. <br />You can set several settings (content, customfields) for parent product. Childs of this parent will basically have the same settings as the parent automatically inherite until you overwrite.</p>\r\n<p>One of the hugest advantages is stock control ability.</p>\r\n<p> </p>', 'Advanced PATTERN', '', '', '', 'advanced-pattern'),
	(134, '', '<p>This is a basic child of Product PATTERN. You see inherited settings, only Product description is overwritten.<br /><span style="background-color: yellow;">Basically Manufacturer and Category are not inherited, for showcase reason both are set in this case.</span></p>', 'Advanced child', '', '', '', 'advanced-child'),
	(135, '', '<p>This is a advanced child of Advanced PATTERN. You see inherited settings. <br />Overwritten are following setting/content:<br />- Product desc<br />- Product price<br /><span style="background-color: yellow;"><br />Basically Manufacturer and Category are not inherited, for showcase reason both are set in this case.</span></p>', 'Advanced price overwrite', '', '', '', 'advanced-price-overwrite'),
	(136, '', '', 'Advanced multiple overrides', '', '', '', 'advanced-multiple-overrides'),
	(137, '', '', 'Product w/child variant w/cart variant', '', '', '', 'product-w-child-variant-w-cart-variant'),
